import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <div className="header">
      <div className="container">
        <div className="row">
          <div className="col-md-10 offset-md-1">
            <h1> Teacher Documentary</h1>
            <p>
              Introducing the medium of documentary, to tell a story or present
              a point of view, is something teachers can do across the
              curriculum with students of different ages and abilities.
            </p>
            <h3>Total Budget : 10,00000</h3>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
